import React, { useState } from 'react';

const AdminDevView = () => {
  const [activeTab, setActiveTab] = useState('providers');
  
  // Empty arrays since we're using real data from backend
  const providers = [];
  const insurance_plans = [];
  const cpt_codes = [];
  const bookings = [];

  const renderProviders = () => (
    <div>
      <h3>Providers Collection ({providers.length} records)</h3>
      <div style={{ 
        padding: '20px', 
        textAlign: 'center', 
        color: '#666',
        background: '#f9f9f9',
        borderRadius: '8px'
      }}>
        <p>Real provider data is now fetched from the backend API.</p>
        <p>Visit <code>/api/providers/</code> to see the actual data.</p>
      </div>
    </div>
  );

  const renderInsurancePlans = () => (
    <div>
      <h3>Insurance Plans Collection ({insurance_plans.length} records)</h3>
      <div style={{ 
        padding: '20px', 
        textAlign: 'center', 
        color: '#666',
        background: '#f9f9f9',
        borderRadius: '8px'
      }}>
        <p>Real insurance data is now fetched from the backend API.</p>
        <p>Visit <code>/api/insurance/</code> to see the actual data.</p>
      </div>
    </div>
  );

  const renderCptCodes = () => (
    <div>
      <h3>CPT Codes Collection ({cpt_codes.length} records)</h3>
      <div style={{ 
        padding: '20px', 
        textAlign: 'center', 
        color: '#666',
        background: '#f9f9f9',
        borderRadius: '8px'
      }}>
        <p>CPT codes are now calculated dynamically based on symptoms.</p>
        <p>Cost estimates use simplified calculations for demo purposes.</p>
      </div>
    </div>
  );

  const renderBookings = () => (
    <div>
      <h3>Bookings Collection ({bookings.length} records)</h3>
      <div style={{ 
        padding: '20px', 
        textAlign: 'center', 
        color: '#666',
        background: '#f9f9f9',
        borderRadius: '8px'
      }}>
        <p>Real booking data is now stored in the backend database.</p>
        <p>Visit <code>/api/bookings/</code> to see the actual data.</p>
      </div>
    </div>
  );

  const tabs = [
    { id: 'providers', label: 'Providers', count: providers.length },
    { id: 'insurance', label: 'Insurance Plans', count: insurance_plans.length },
    { id: 'cpt', label: 'CPT Codes', count: cpt_codes.length },
    { id: 'bookings', label: 'Bookings', count: bookings.length },
  ];

  return (
    <div className="container">
      <div className="card">
        <h1 style={{ marginBottom: '30px', color: '#333' }}>
          Admin / Developer View
        </h1>
        
        <div style={{ 
          background: '#f8f9fa', 
          padding: '16px', 
          borderRadius: '8px', 
          marginBottom: '30px' 
        }}>
          <h3 style={{ marginBottom: '8px' }}>📊 Database Collections</h3>
          <p style={{ margin: 0, color: '#666' }}>
            This view shows the raw data from all MongoDB collections for testing and development purposes.
          </p>
        </div>

        {/* Tab Navigation */}
        <div style={{ 
          display: 'flex', 
          borderBottom: '2px solid #e1e5e9',
          marginBottom: '20px'
        }}>
          {tabs.map(tab => (
            <button
              key={tab.id}
              onClick={() => setActiveTab(tab.id)}
              style={{
                padding: '12px 20px',
                border: 'none',
                background: activeTab === tab.id ? '#007bff' : 'transparent',
                color: activeTab === tab.id ? 'white' : '#666',
                cursor: 'pointer',
                borderBottom: activeTab === tab.id ? '2px solid #007bff' : 'none',
                marginBottom: '-2px'
              }}
            >
              {tab.label} ({tab.count})
            </button>
          ))}
        </div>

        {/* Tab Content */}
        <div style={{ minHeight: '400px' }}>
          {activeTab === 'providers' && renderProviders()}
          {activeTab === 'insurance' && renderInsurancePlans()}
          {activeTab === 'cpt' && renderCptCodes()}
          {activeTab === 'bookings' && renderBookings()}
        </div>

        <div style={{ 
          background: '#e8f5e8', 
          padding: '16px', 
          borderRadius: '8px', 
          marginTop: '30px',
          border: '1px solid #28a745'
        }}>
          <h3 style={{ color: '#155724', marginBottom: '8px' }}>🔧 Development Notes</h3>
          <ul style={{ color: '#155724', margin: 0, paddingLeft: '20px' }}>
            <li>All data is currently stored in static JavaScript files</li>
            <li>In production, this would connect to MongoDB collections</li>
            <li>Provider matching logic is simplified for demo purposes</li>
            <li>Cost calculations use sample insurance coverage rates</li>
          </ul>
        </div>
      </div>
    </div>
  );
};

export default AdminDevView;
